style.css:
@-moz-document domain("wikipedia.org") {
/* Ocultar el logo original */
    .mw-wiki-logo {
        display: none;
    }

    /* Agregar el nuevo logo */
    #p-logo {
        background: url('https://www.unp.edu.ar/images/principal/escudo_tranparente_sinletras.png') no-repeat center center;
        background-size: contain;
        width: 135px; /* Ajusta el ancho del logo según sea necesario */
        height: 155px; /* Ajusta la altura del logo según sea necesario */
    }

    /* Ajustar el contenedor del logo para evitar conflictos de diseño */
    #p-logo a {
        display: block;
        width: 100%;
        height: 100%;
    }
}
